import itertools

def solve():
    n, m = map(int, input().split())
    edges = []
    for _ in range(m):
        u, v, c = map(int, input().split())
        edges.append((u, v, c))

    min_cost = float('inf')

    for i in range(1 << m):
        cost = 0
        remaining_edges = []
        for j in range(m):
            if (i >> j) & 1 == 0:
                remaining_edges.append(edges[j])
            else:
                cost += edges[j][2]

        adj = [[] for _ in range(n + 1)]
        for u, v, c in remaining_edges:
            adj[u].append(v)
            adj[v].append(u)

        q = [[1]]
        visited = {1}
        paths = []

        while q:
            path = q.pop(0)
            last_node = path[-1]

            if last_node == n:
                paths.append(path)
                continue

            for neighbor in adj[last_node]:
                if neighbor not in visited:
                    new_path = path + [neighbor]
                    q.append(new_path)
                    visited = set(new_path)


        if len(paths) == 1:
            min_cost = min(min_cost, cost)

    print(min_cost)

